// MyPage.js
// 마이페이지
import React from 'react';

const MyPage = () => {
  return (
    <div className="my-page">
      <h1>마이페이지</h1>
      <p>추가.</p>
      {/* 사용자 정보와 활동 내역 등을 여기에 추가할 수 있습니다 */}
    </div>
  );
};

export default MyPage;
